// import List from "./List";
import * as ass from "./Heading";
import * as cal from "./Cal.jsx";

function Calapp(){
    return (
        <>
        <ass.default/>
        <h1>add {cal.default(40,10)}</h1>
        <h1>sub {cal.sub(40,10)}</h1>
        <h1>mul {cal.mul(40,10)}</h1>
        <h1>div {cal.div(10,3)}</h1>
    </>
    );
    
}

export default Calapp;
